import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Projects</h1>
      <div className="box">
        <br />
        <h2>Projects</h2>
        <br />
        <div className="box2">
          <input type={"text"} placeholder='enter project name'/><button>save</button><br/>
          <hr/>
        </div>
      </div>
    </div>
  );
}

export default App;
